import { Link } from 'react-router-dom';

const UserCard = ({ name, age, major, hobbies, careerAspirations, imageSrc }) => {
  return (
    <div className="col-6 col-lg-3">
      <div className="user mb-4">
        <div className="user-body">
          <img className="pb-3 profile-image" src={imageSrc} alt={` Picture of ${name}`} />
          <h2>{name}</h2>
          <p>Age: {age}</p>
          <p>Major: {major}</p>
          <p>Hobbies: {hobbies}</p>
          <p>Career Aspirations: {careerAspirations}</p>
          <Link to={`/profile/${name}`} className="btn btn-dark">View Profile</Link>
          <br />
          <button className="swipe-button swipe-left">Swipe Left</button>
          <button className="swipe-button swipe-right">Swipe Right</button>
        </div>
      </div>
    </div>
  );
};
export default UserCard;
